import { useSelector } from 'react-redux';
import { Carousel } from 'react-responsive-carousel';

const carousel = () => {
const createCarouselItemImage = (pet, i) => (
    <div key={i}>
        <img src={`/assets/${i}.jpeg`} />
        <p className="legend">Legend {i}</p>
    </div>
);


const baseChildren = <div>{[1, 2, 3, 4, 5].map(createCarouselItemImage)}</div>;

    const foundations = useSelector((state)=>state.foundations[0])
    return (
        <Carousel>{baseChildren.props.children}</Carousel>
    )
}

export default carousel
